const VerticalBar = () => {

    return (

        <div className="progress">
        <div className="progress-bar" role="progressbar" style={{width: "15%"}} aria-valuenow="15" aria-valuemin="0" aria-valuemax="100"></div>
        <div className="progress-bar bg-success" role="progressbar" style={{width: "15%"}}aria-valuenow="30" aria-valuemin="0" aria-valuemax="100"></div>
        <div className="progress-bar bg-info" role="progressbar" style={{width: "15%"}} aria-valuenow="20" aria-valuemin="0" aria-valuemax="100"></div>
      </div>

    )
}

export default VerticalBar
